  const { theme } = useContext(DataUsers);

  useEffect(() => {
    console.log("renderizando contacto");
  }, []);
  return (
    <DataUsersProvider>
      <div
        style={{ background: theme.background, color: theme.color }}
        className="App"
      >
        <Navbar />

        <Outlet />

        <Footer />
      </div>
    </DataUsersProvider>
  );
}

export default App;
